import './App.css';
import {Route,Routes,BrowserRouter} from 'react-router-dom';
import Timer from './Timer';
import Navbar from './Navbar';
function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar>
        <Routes>
          <Route path='/Timer' element={<Timer />}/>
        </Routes> 
      </Navbar>
      </BrowserRouter>
    </div>
  );
}

export default App;
